import React, { Component } from 'react'
import { Card, Divider, Table, Statistic, Row, Col, Select, Layout, Button } from 'antd'
import UserHead from '../../../components/UserHead';

import MyNavLink from '../../../components/MyNavLink'
const { Countdown } = Statistic
const deadline = Date.now() + 1000 * 60 * 30
export default class OrderInfo extends Component {

    state = {
        dataSource: [
            {
                key: 1,
                order: 1,
                name: '张三',
                idCard: '510811111111',
                level: 1,
                carriageNumber: '01',
                seatNumber: '1A',
                price: 100,
            },
            {
                key: 2,
                order: 2,
                name: '李四',
                idCard: '510811111111',
                level: 1,
                carriageNumber: '01',
                seatNumber: '1A',
                price: 100,
            },
        ],
        order: 1,
    }

    onFinish = () => {

    }

    render() {

        const { dataSource } = this.state

        const columns = [
            {
                title: '序号',
                dataIndex: 'order',
                key: '1',
                align: 'center',
            },
            {
                title: '姓名',
                dataIndex: 'name',
                key: '2',
                align: 'center',
            },
            {
                title: '证件号码',
                key: '4',
                dataIndex: 'idCard',
                align: 'center',
            },
            {
                title: '席别',
                dataIndex: 'level',
                key: '4',
                align: 'center',
            },
            {
                title: '车厢',
                key: '5',
                dataIndex: 'carriageNumber',
                align: 'center',
            },
            {
                title: '席位号',
                key: '6',
                dataIndex: 'seatNumber',
                align: 'center',
            },
            {
                title: '票价（元）',
                key: '7',
                dataIndex: 'price',
                align: 'center',
            },
        ];

        return (
            <div>
                <UserHead />
                <Layout style={{ backgroundColor: '#fff' }}>
                    {/* <Header style={{ backgroundColor: '#fff'}}> */}
                    <h1 style={{
                        border: 'solid 1px #298CCE',
                        width: '1000px',
                        height: '80px',
                        marginTop: '50px',
                        marginLeft: '400px',
                        textAlign: 'center',
                        lineHeight: '80px'
                    }}>
                        <div>
                            席位已锁定，请在
                            <span style={{ color: '#fb7403' }}>30</span>
                            分钟内进行支付，完成订票。支付剩余时间：
                            <span>
                                <Countdown
                                    valueStyle={{ color: '#fb7403' }}
                                    style={{ marginLeft: '600px', marginTop: '-59px' }}
                                    value={deadline} onFinish={this.onFinish}
                                    format='mm:ss' /></span>

                        </div>
                    </h1>


                    {/* </Header> */}
                    {/* <Content style={{marginTop:'100px',backgroundColor:'#fff',height:'1000px'}}> */}
                    <Card
                        style={{ marginTop: '25px' }}
                        title="订单信息"
                        headStyle={{ backgroundColor: '#3B99FC', width: '1000px', marginLeft: '400px', marginTop: '50px' }}
                        bodyStyle={{ backgroundColor: '#FFFFFF', width: '1000px', marginLeft: '400px' }}
                        bordered={false}
                    >
                        <div>
                            <p className="order-train-info-p">
                                <strong className="order-train-info-mr5">2021-07-04</strong>
                                <strong className="order-train-info-ml5">G2121</strong>
                                次
                                <strong className="order-train-info-ml5">成都东</strong>
                                站
                                <strong className="order-train-info-s">（17:35开）——北京</strong>
                                站（19:35到）
                            </p>
                        </div>
                        <Divider dashed />
                        <Table
                            columns={columns}
                            dataSource={dataSource}
                            bordered
                            rowKey="key"
                            pagination={false}
                        />
                    </Card>
                    {/* </Content> */}
                    <div>
                        <Button shape="round" style={{ marginLeft: '750px' }}>取消订单</Button>
                        <MyNavLink to="/user/orderComplete">
                            <Button shape="round" style={{ backgroundColor: '#FF8000', marginLeft: '200px', marginTop: '50px', color: '#fff' }}>网上支付</Button>
                        </MyNavLink>
                    </div>
                </Layout>
            </div>

        )
    }
}
